import { useState } from "react";
import OutputList from "./OutputList";
import React from 'react';


const Prediction = () => {
  const [prediction, setPrediction] = useState([
    //{ title: 'My new website', body: 'lorem ipsum...', author: 'mario', id: 1 },
    { title: 'Welcome party!', body: 'lorem ipsum...', author: 'yoshi', id: 2 },
    { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'mario', id: 3 }
  ])

  const handleDelete = (id) => {
    const newPrediction = prediction.filter(prediction => prediction.id !== id);
    setPrediction(newPrediction);
  }

  return (
    <div className="Preciction">
        <input type="text" name="Langitude" placeholder="Langitude" required></input>
        <input type="text" name="Longitude" placeholder="Longitude" required></input>
      <OutputList prediction={prediction} title="All Blogs" handleDelete={handleDelete} />
    </div>
  );
}

export default Prediction;
